import folium
from shapely.geometry import LineString

# Function to extract coordinates from LINESTRING input
def extract_coordinates(linestring):
    import re
    pattern = r"\(([^)]+)\)"
    match = re.search(pattern, linestring)
    if not match:
        raise ValueError("Invalid LINESTRING format")
    coord_string = match.group(1)
    return [tuple(map(float, coord.split())) for coord in coord_string.split(',')]

